import React, {useEffect, useContext} from 'react';
import ComputerPartFinder from "../apis/ComputerPartFinder";
import {ComputerPartsContext} from '../context/ComputerPartsContext';
import {Table, Typography} from "antd";
import {v4 as uuid} from 'uuid'

const {Text, Link} = Typography;
const ComputerPartList = (props) => {

   const {computerPart, setComputerPart} = useContext(ComputerPartsContext);

   useEffect(() => {
      const fetchData = async () => {
         try {
            const response = await ComputerPartFinder.get("/")
            setComputerPart(response.data.data.computerPart);
            console.log(response);
         } catch (err) {
         }
      }

      fetchData();
   }, [])

   const columns = [
      {
         title: "Name",
         dataIndex: "name",
         key: "name",
         width:300
      },
      {
         title: "Type",
         dataIndex: "type",
         key: "type",
      },
      {
         title: "Price",
         dataIndex: "price",
         key: "price",
         sorter: (a, b) => a.price - b.price
      },
      {
         title: "Website",
         dataIndex: "weburl",
         key: "weburl",
         render: weburl => <Link>{weburl}</Link>
      },
   ]

   const data = computerPart && computerPart.map(part => {
         if (part.itemid < 200) {
            return (
               {
                  key: uuid(),
                  name: part.itemname,
                  type: "GPU",
                  price: part.price,
                  weburl: part.weburl
               }
            )
         } else if (part.itemid < 300) {
            return (
               {
                  key: uuid(),
                  name: part.itemname,
                  type: "CPU",
                  price: part.price,
                  weburl: part.weburl
               }
            )
         } else {
            return (
               {
                  key: uuid(),
                  name: part.itemname,
                  type: "RAM",
                  price: part.price,
                  weburl: part.weburl
               }
            )
         }

      }
   )
   console.log(data);
   return (<Table scroll={{x:'calc(700px + 50%)',y:500}} columns={columns} dataSource={data}/>)
}

export default ComputerPartList
